import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './project/App';
import App2 from './project/Addr2';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <App2 />
  </React.StrictMode>
);
